'use strict';

var Web3 = require('web3');
var contract = require("@truffle/contract");
var provider = new Web3.providers.HttpProvider("http://localhost:8545");



/**
 * Add device to inventory
 *
 * body Body Add device with given name, owner and location
 * returns inline_response_200_1
 **/
exports.addDevice = function(body) {
  return new Promise(function(resolve, reject) {
    resolve(add(body.name, body.owner, body.location));
  });
}


/**
 * Checkin device into inventory
 *
 * id Integer Checkin device of given ID
 * returns inline_response_200_1
 **/
exports.checkinDevice = function(id) {
  return new Promise(function(resolve, reject) {
    resolve(checkin(id));
  });
}


/**
 * Checkout device from inventory
 *
 * id Integer Checkout device of given ID
 * returns inline_response_200_1
 **/
exports.checkoutDevice = function(id) {
  return new Promise(function(resolve, reject) {
    resolve(checkout(id));
  });
}


/**
 * List devices in inventory
 *
 * returns inline_response_200
 **/
exports.listDevices = function() {
  return new Promise(function(resolve, reject) {
    resolve(list());
  });
}


/**
 * Look up device information
 *
 * id Integer Look up information of given ID
 * returns inline_response_200
 **/
exports.lookUpDevices = function(id) {
  return new Promise(function(resolve, reject) {
    resolve(lookup(id));
  });
}


/**
 * Modify device information
 *
 * id Integer Modify information of given ID
 * body Body_1 Modify device information with given name, owner and location
 * returns inline_response_200_1
 **/
exports.modifyDevice = function(id,body) {
  return new Promise(function(resolve, reject) {
    resolve(modify(id, body.name, body.owner, body.location));
  });
}


/**
 * Remove device from inventory
 *
 * id Integer Remove device of given ID
 * returns inline_response_200_1
 **/
exports.removeDevice = function(id) {
  return new Promise(function(resolve, reject) {
    resolve(remove(id));
  });
}


/**
 * Request device checkin into inventory
 *
 * id Integer Request device checkin of given ID
 * returns inline_response_200_1
 **/
exports.requestCheckin = function(id) {
  return new Promise(function(resolve, reject) {
    resolve(requestCheckin(id));
  });
}



function getState(num) {				// Convert state integer to string
  if(num == 3) {
    return "pending";
  } else if(num == 2) {
    return "checkedOut";
  } else {
    return "inStore";
  }
}


async function list() {					// List devices in inventory
  var inventory = await Inventory.deployed();
  var result = await inventory.list({
    from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
  });
  var deviceNum = await inventory.deviceNum();
  var results = [];
  for(var i=0; i<deviceNum.toNumber(); i++) {
    results.push({
      id: result.logs[i].args.id.toNumber(),
      name: result.logs[i].args.name,
      owner: result.logs[i].args.owner,
      location: result.logs[i].args.location,
      state: getState(result.logs[i].args.state.toNumber())
    });
  }
console.log(result);
  return results;
}


async function add(name, owner, location) {		// Add device to inventory
  var inventory = await Inventory.deployed();
  var result = await inventory.add(name, owner, location, {
    from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
  });
console.log(result);
  return({status: "OK"});
}


async function remove(id) {				// Remove device from inventory
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var result = await inventory.remove(id, {
      from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
    });
console.log(result);
    return({status: "OK"});
  }
  return({status: "Error"});
}


async function modify(id, name, owner, location) {	// Modify device info
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var result = await inventory.modify(id, name, owner, location, {
      from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
    });
console.log(result);
    return({status: "OK"});
  }
  return({status: "Error"});
}


async function lookup(id) {				// Look up device info
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var result = await inventory.lookUp(id);
console.log(result);
    return({
      name: result.name,
      owner: result.owner,
      location: result.location,
      state: getState(result.state)
    });
  }
  return({
    name: "Does not exist",
    owner: "Does not exist",
    location: "Does not exist",
    state: "Does not exist"
  });
}


async function checkout(id) {				// Checkout device from inventory
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var info = await inventory.lookUp(id);
    if(info.state == 1) {
      var result = await inventory.checkout(id, {
        from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
      });
console.log(result);
      return({status: "OK"});
    }
  }
  return({status: "Error"});
}


async function requestCheckin(id) {			// Request device checkin
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var info = await inventory.lookUp(id);
    if(info.state == 2) {
      var result = await inventory.requestCheckin(id, {
        from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
      });
console.log(result);
      return({status: "OK"});
    }
  }
  return({status: "Error"});
}


async function checkin(id) {				// Checkin device into inventory
  var inventory = await Inventory.deployed();
  var valid = await inventory.validateID(id);
  if(valid) {
    var info = await inventory.lookUp(id);
    if(info.state == 3) {
      var result = await inventory.checkin(id, {
        from: "0xe1f76CEc4539F27dc06AF54048dddc0C3680C0f8"
      });
console.log(result);
      return({status: "OK"});
    }
  }
  return({status: "Error"});
}



